import React, { useState } from 'react';
import { View, Text, Pressable, Image, TextInput, Modal } from "react-native";
import { CheckBox } from 'react-native-elements';
import CountryDropdown from './CountryDropdown'


const EnterAuthCode = () => {
  return (
    <View className={"flex-1  bg-white"}>
      <View className={"bg-gray-200"}><Text className={"font-bold text-black-400 p-2 text-center"}>Vui lòng không chia sẽ mã xác thực để tránh mất tài khoản</Text></View>

      <View>
        <View><Image style={{ width: '100%', height: null, aspectRatio: 1 }} resizeMode='contain' source={require('/assets/phone.png')} ></Image></View>
        <View>
          <Text>Đang gọi đến số (+84) 338 030 541</Text>
          <Text>Vui lòng bắt máy để nghe mã</Text>
        </View>
      </View>
      <View className="flex flex-row">
        <TextInput  style={{ width:30, borderBottomColor: 'gray', borderBottomWidth: 2 }}></TextInput>
        <TextInput  style={{ width:30, borderBottomColor: 'gray', borderBottomWidth: 2 }}></TextInput>
        <TextInput  style={{ width:30, borderBottomColor: 'gray', borderBottomWidth: 2 }}></TextInput>
        <TextInput  style={{ width:30, borderBottomColor: 'gray', borderBottomWidth: 2 }}></TextInput>
        <TextInput  style={{ width:30, borderBottomColor: 'gray', borderBottomWidth: 2 }}></TextInput>
      </View>
    </View>
  )
};
export default EnterAuthCode;
